import React, { useState } from "react";
import FileUpload from "./components/FileUpload";
import Header from "./components/Header";
import "./App.css";

const App = () => {
  const [hide, setHide] = useState(false);

  return (
    <div>
      <Header />
      <FileUpload hidden={this.StaticRange.hide} />
    </div>
  );
};

export default App;
